import React from "react"
import Header from "./components/Header";

const textH = {
    name: "Damir",
    age: 12
};


class App extends React.Component {
    render() {
        return (
            <div className="name">
                <Header title="dam"></Header>
                <InputEx></InputEx>
                <h1>Hello, {textH.name}</h1>
                <h1></h1>
                <p>
                    <input className="inp" placeholder="999" onClick={this.inputClick}></input>
                </p>
                <p>
                    {textH.age == 18 ? "YES" : "NO"}
                </p>
            </div>
        )
    }
    inputClick() { console.log("Clicked") }
}


export default App
